import styled from "styled-components";
import map from "../images/Map.jpeg";

const homePage = ()  => {
    return (
      <Wrap>
        <TitleWrap>
          <Title>Adarsh mithila party</Title>
        </TitleWrap>
        <Map><img src={map} alt="map"/></Map>
      </Wrap>
    );
  };
const Wrap = styled.main`
